-- База данных VK.
drop database if exists vk;
create database vk;
use vk;

-- Справочник ролей пользователей.
drop table if exists roles;
create table roles (
    id int unsigned not null auto_increment primary key comment "Идентификатор роли",
    name varchar(255) not null comment "Наименование роли",
    created_at timestamp default current_timestamp comment "Дата создания записи",
    updated_at timestamp default current_timestamp on update current_timestamp comment "Дата последней правки записи",
    UNIQUE INDEX `id_UNIQUE` (`id` ASC)
) comment = "Роли пользователя в системе";

-- Таблица зарегистрированных пользователей.
drop table if exists users;
create table users (
    id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY comment "Идентификатор учетной записи пользователя",
    name VARCHAR(255) NOT NULL comment "Наименование учетной записи пользователя",
    email VARCHAR(255) NOT NULL comment "Электронная почта пользователя",
    email_confirmed BIT NOT NULL DEFAULT 0 comment "Достоверность электронной почты пользователя",
    phone VARCHAR(64) NOT NULL comment "Телефон пользователя",
    phone_confirmed BIT NOT NULL DEFAULT 0 comment "Достоверность телефона пользователя",
    password_hash VARCHAR(1024) comment "Хэш пароля пользователя",
    blocked BIT NOT NULL DEFAULT 0 comment "Блокировка учетной записи пользователя",
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP comment "Дата создания записи",
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP comment "Дата последней правки записи",
    UNIQUE INDEX `id_UNIQUE` (`id` ASC)
) comment = "Учетная запись пользователя";

-- Таблица ролей пользователя.
drop table if exists user_roles;
create table user_roles (
    user_id int unsigned not null comment "Идентификатор учетной записи пользователя",
    role_id int unsigned not null comment "Идентификатор роли",
    primary key (user_id, role_id),
    foreign key (user_id)
    references users (id) 
    on update cascade,
    foreign key (role_id)
    references roles (id)
    on update cascade
) comment = "Учетная запись пользователя";

-- Таблица типов медиафайлов.
drop table if exists media_types;
create table media_types (
    id int unsigned not null auto_increment primary key comment "Идентификатор типа медиа файла",
    name varchar(255) not null unique comment "Наименование типа медиа файла",
    created_at timestamp default current_timestamp comment "Дата создания записи",
    updated_at timestamp default current_timestamp on update current_timestamp comment "Дата последней правки записи"
) comment = "Типы медиа файлов";

-- Таблица медиафайлов.
drop table if exists media;
create table media (
    id int unsigned not null auto_increment primary key comment "Идентификатор медиа файла",
    media_type_id int unsigned not null comment "Идентификатор типа медиа файла",
    user_id int unsigned not null comment "Идентификатор собственника медиа файла",
    filename varchar(255) not null comment "Путь медиа файла",
    size int not null comment "Размер медиа файла",
    metadata JSON comment "Метаданные медиа файла",
    hash VARCHAR(1024) comment "Хэш медиа файла",
    created_at timestamp default current_timestamp comment "Дата создания записи",
    updated_at timestamp default current_timestamp on update current_timestamp comment "Дата последней правки записи",
    foreign key (user_id)
    references users (id)
    on update cascade,
    foreign key (media_type_id)
    references media_types (id)
    on update cascade
) comment = "Медиа файлы";

-- Таблица регионов, правильнее использовать либо ОКАТО, либо КЛАДР, по идее можно использовать привязку к геоданным.
drop table if exists regions;
CREATE TABLE regions (
    id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY comment "Идентификатор региона",
    name VARCHAR(150) NOT NULL comment "Наименование региона",
    parent_id INT unsigned DEFAULT NULL comment "Родительский элемент",
    code INT DEFAULT NULL comment "Кодификационный код",
    zip INT DEFAULT NULL comment "Почтовый индекс",
    created_at timestamp default current_timestamp comment "Дата создания записи",
    updated_at timestamp default current_timestamp on update current_timestamp comment "Дата последней правки записи"
) comment = "Регион";

-- Таблица профилей пользователя.
drop table if exists profiles;
create table profiles (
    user_id int unsigned not null primary key comment "Идентификатор пользователя",
    first_name varchar(100) not null comment "Имя",
    last_name varchar(100) not null comment "Фамилия",
    sex char(1) not null comment "Пол",
    birthday date comment "Дата рождения",
    hometown varchar(100) comment "Город",
    photo_id int unsigned not null comment "Идентификатор аватарки",
    region_id int unsigned default null comment "Идентификатор региона",
    created_at timestamp default current_timestamp comment "Дата создания записи",
    updated_at timestamp default current_timestamp on update current_timestamp comment "Дата последней правки записи",
    foreign key (user_id)
    references users (id)
    on update cascade,
    foreign key (region_id)
    references regions (id)
    on update cascade,
    foreign key (photo_id)
    references media (id)
    on update cascade
) comment = "Профиль пользователя";

-- Таблица сообщений.
drop table if exists messages;
create table messages (
    id int unsigned not null auto_increment primary key comment "Идентификатор сообщения", 
    from_user_id int unsigned not null comment "От кого",
    to_user_id int unsigned not null comment "Кому",
    body text not null comment "Текст сообщения",
    important boolean  comment "Важность",
    delivered boolean comment "Прочитано",
    created_at timestamp default current_timestamp comment "Дата создания записи",
    updated_at timestamp default current_timestamp on update current_timestamp comment "Дата последней правки записи",
    foreign key (from_user_id)
    references users (id)
    on update cascade,
    foreign key (to_user_id)
    references users (id)
    on update cascade
) comment = "Сообщения";

-- Таблица состояний дружбы.
drop table if exists friendship_statuses;
create table friendship_statuses (
    id int unsigned not null auto_increment primary key comment "Идентификатор статуса дружбы",
    name varchar(150) not null unique comment "Наименование статуса дружбы",
    created_at timestamp default current_timestamp comment "Дата создания записи",
    updated_at timestamp default current_timestamp on update current_timestamp comment "Дата последней правки записи"
) comment = "Статус дружбы";

-- Таблица дружбы.
drop table if exists friendship;
create table friendship (
    user_id int unsigned not null comment "Идентификатор инициатора дружбы",
    friend_id int unsigned not null comment "Идентификатор друга",
    status_id int unsigned not null comment "Идентификатор статуса дружбы",
    requested_at datetime default now() comment "Дата запроса дружбы",
    confirmed_at datetime comment "Дата подтверждения дружбы",
    primary key (user_id, friend_id),
    foreign key (user_id)
    references users (id)
    on update cascade,
    foreign key (friend_id)
    references users (id)
    on update cascade,
    foreign key (status_id)
    references friendship_statuses (id)
    on update cascade
) comment = "Друзья";

-- Таблица групп.
drop table if exists communities;
create table communities (
    id int unsigned not null auto_increment primary key comment "Идентификатор сообщества",
    name varchar(150) not null unique comment "Наименование сообщества",
    created_at timestamp default current_timestamp comment "Дата создания записи",
    updated_at timestamp default current_timestamp on update current_timestamp comment "Дата последней правки записи"
) comment = "Сообщества";

-- Таблица связей пользователей и групп.
drop table if exists communities_users;
create table communities_users (
    community_id int unsigned not null comment "Идентификатор сообщества",
    user_id int unsigned not null comment "Идентификатор пользователя",
    primary key (community_id, user_id),
    created_at timestamp default current_timestamp comment "Дата создания записи",
    updated_at timestamp default current_timestamp on update current_timestamp comment "Дата последней правки записи",
    foreign key (user_id)
    references users (id)
    on update cascade,
    foreign key (community_id)
    references communities (id)
    on update cascade
) comment = "Участники сообщества";

-- Таблица типов объектов рейтинга.
drop table if exists target_types;
create table target_types (
    id int unsigned not null auto_increment primary key comment "Идентификатор объекта социальной сети",
    name varchar(255) not null unique comment "Наименование объекта социальной сети",
    created_at timestamp default current_timestamp comment "Дата создания записи",
    updated_at timestamp default current_timestamp on update current_timestamp comment "Дата последней правки записи"
) comment = "Объекты социальной сети";

-- Таблица лайков, не лаек.
drop table if exists likes;
create table likes (
    id int unsigned not null auto_increment primary key comment "Идентификатор лайка",
    user_id int unsigned not null comment "Идентификатор пользователя",
    target_id int unsigned not null comment "Идентификатор объекта социальной сети",
    target_type_id int unsigned not null comment "Идентификатор типа объекта социальной сети",
    created_at timestamp default current_timestamp comment "Дата создания записи",
    foreign key (user_id)
    references users (id)
