-- Таблица эмоций.
drop table if exists emoji;
CREATE TABLE emoji (
    id INT UNSIGNED NOT NULL AUTO_INCREMENT primary key comment "Идентификатор эмоции",
    name VARCHAR(150) NOT NULL comment "Наименование эмоции",
    file MEDIUMBLOB NOT NULL comment "Путь к файлу изображения эмоции",
    created_at timestamp default current_timestamp comment "Дата создания записи",
    updated_at timestamp default current_timestamp on update current_timestamp comment "Дата последней правки записи",
    UNIQUE KEY name (name)
) comment = "Эмоции";

-- Таблица новостей пользователя.
